abstract class RR{
   int[] grade;
   public RR(int[] grade){
      this.grade = grade;
   }
   public abstract double mark();
}
 class RT extends RR{
	public RT(int[] grade) {
		super(grade);
	}
	public double mark() {
		int max=0,min=100;
		int sum=0;
		for(int i=0;i<5;i++) {
			sum+=grade[i];
			if(grade[i]>max)
				max=grade[i];
			else if(grade[i]<min)
				min=grade[i];
		}
		return (sum-max-min)/3;
	}
}

