import java.util.Scanner;
public class Main{
	public static void main(String[] args) {
		Scanner S=new Scanner(System.in);
		String s=S.next();
		int i=0,j=0,n=s.length();
		String str = "";
		for(int k=0;k<n;k++) {
			if(s.charAt(k)==',') {
				System.out.print("d["+i+","+j+"] = "+str+" ");
				j++;str = "";
			}
			else if(s.charAt(k)==';') {
				System.out.println("d["+i+","+j+"] = "+str);
				j=0;i++;str = "";
			}
			else if(k == n-1) {
				str=str+s.charAt(k);
				System.out.println("d["+i+","+j+"] = "+str);
			}
			else str=str+s.charAt(k);
		}
	}
}

