        if(isHuiWen(n))
            System.out.println("Y");
        else
            System.out.println("N");
    }
    public static boolean isHuiWen(int n){
        int m = reverse(n);
        if(m == n ){
            return true;
        }else
            return false;
    }
    private static int reverse(int n) {
        int temp = 0;
        int j = 0;
        temp = n;
        while(temp != 0){
            j = j*10 + temp%10;
            temp /= 10;
        }
        return j;
    }
}

