        }
        StringBuffer str = new StringBuffer();
        int num = 1;
        for (int start = 0, end = 5; end < chars.length; start += 8, end += 8) {
            String s1 = "";
            for (int i = start; i <= end; i++) {
                s1 += chars[i];
            }
            if (s1.equals("202017")) {
                str.append(17);
                str.append(chars[end+1]);
                str.append(chars[end+2]);
                if(end+8<chars.length)
                    str.append(" ");
            } else if (s1.equals("202061")) {
                str.append(61);
                str.append(chars[end+1]);
                str.append(chars[end+2]);
                if(end+8<chars.length)
                    str.append(" ");

            }
        }
        return str.toString();
    }
}
