public class Main {
    public static void main(String[] args) {
        int a = 100;
        while (a >= 100 && a <= 153) {
            int b = a % 10, c = (int) ((a - b) * 0.1 % 10), d = (int) (((a - b) * 0.1 - c) * 0.1 % 10);
            if (a == b * b * b + c * c * c + d * d * d)
                System.out.print(a);
            a++;
        }
        a = 154;
        while (a > 153 && a <= 999) {
            int b = a % 10, c = (int) ((a - b) * 0.1 % 10), d = (int) (((a - b) * 0.1 - c) * 0.1 % 10);
            if (a == b * b * b + c * c * c + d * d * d)
                System.out.print("," + a);
            a++;
        }
    }
}

