        String[] nums = str.split("\\\\D+");  
             //对字符串str利用非数字字符串进行分割为字符串数组
             // 如：1+2 经分割后变成：arr[0]——"1"；arr[1]——"2"
             //注意：得到的数字目前是字符串类型，如果要参与计算，必须转换为数值类型（整型或实型）
             // split方法中的参数为正则表达式类型，其中：第1个“\\”表示转义符，“\\D”表示 非数字字符，“+”表示前面的字符出现1次或多次
       String[] opers=str.split("\\\\d+");
           //对字符串str利用数字字符串进行分割为字符串数组
           // 如：1+2 经分割后变成：opers[0]——""；opers[1]——"+"
           // split方法中的参数为正则表达式类型，其中：第1个“\\”表示转义符，“\\d”表示 数字字符，“+”表示前面的字符出现1次或多次
        //System.out.println(Arrays.toString(nums));    //查看nums数组的数据
        //System.out.println(Arrays.toString(operators));  //查看operators数组的数据
        int num1 = Integer.parseInt(nums[0]);  //将第1个操作数由字符串转换为整数
        int num2 = Integer.parseInt(nums[1]);  //将第2个操作数由字符串转换为整数
        switch (opers[1]){   //若操作符的值是如下的一个，则进行相应操作
            case "+":  //+运算后输出。
                System.out.println(num1+num2);
                break;
            case "-": //-运算后输出
                System.out.println(num1-num2);
                break;
            case "*": //*运算后输出
                System.out.println(num1*num2);
                break;
            case "/": // /运算后输出
                System.out.println(num1/num2);
                break;
        }
    }
}

