public class Main {
    public static void main(String[] args) {
        Scanner scan = new Scanner(System.in);
        //接收年份以及日期
        int year = scan.nextInt();
        int month = scan.nextInt();

        //使用数组存储每个月的天数
        int[] day = new int[]{31, 29, 31, 30, 31, 30, 31, 31, 30, 31, 30, 31};
        //先确定这一年的这一个月的周六周日的起始位置
        //从1970-01-01开始算到输入的这个月份上
        //闰年是366，平年是365天

        //1.先算有多少个闰年：从1970年开始遍历
        int count = 0, Sum = 0;

        //判断今年是否是闰年
        if (year % 100 != 0 && year % 4 == 0 || year % 400 == 0) {
            //如果是闰年,则这个月之前的总天数
            for (int k = 0; k < month - 1; k++) {
                Sum += day[k];
            }

        } else {
            //如果不是闰年，则这个月之前的总天数
            day[1] = 28;
            for (int k = 0; k < month - 1; k++) {
                Sum += day[k];
            }
        }

        //判断在输入的年之前，有多少个闰年
        for (int i = 1970; i < year; i++) {
            if (i % 100 != 0 && i % 4 == 0 || i % 400 == 0) {
                count++;
            }
        }
        //年的天数
        long sum = 366 * count + (year - 1970 - count) * 365 + 3;
        //加上月的天数
        if (month >= 2) {
            sum = sum + Sum;
        }
//        System.out.println(sum);
        //先算这个月的一月一号的星期数为多少：w代表
        long w = sum % 7 + 1;
//        System.out.println("这个月的第一天为星期" + w);

        String m, d;
        if (month >= 10)
            m = "-" + month;
        else
            m = "-0" + month;


        //得到这一个月的第一天是星期w的时候，算这个月第一个星期六的日期2018-06-02
        if (w == 6) {
            //每加上7天就是一个星期六
            for (int i = 1; i <= day[month - 1]; i += 7) {

                if (i >= 10) {
                    d = "-" + i;
                } else {
                    d = "-0" + i;
                }

                System.out.println(year + m + d);
                if (i + 1 <= day[month - 1]) {
                    if (i + 1 >= 10) {
                        d = "-" + (i+1);
                    } else {
                        d = "-0" + (i+1);
                    }
                    System.out.println(year + m + d);
                }

            }
        } else if (w == 7) {
            System.out.println(year + m + "-01");
            for (int i = 7; i <= day[month - 1]; i += 7) {

                if (i >= 10) {
                    d = "-" + i;
                } else {
                    d = "-0" + i;
                }

                System.out.println(year + m + d);
                if (i + 1 <= day[month - 1]) {
                    if (i + 1 >= 10) {
                        d = "-" + (i+1);
                    } else {
                        d = "-0" + (i+1);
                    }
                    System.out.println(year + m + d);
                }
            }

        }else {//这种情况就是比周六小的星期
            long c = 6 - w;
            //周六则是从1 + c开始的
            for (long i = 1 + c; i<= day[month - 1];i += 7){
                if (i >= 10) {
                    d = "-" + i;
                } else {
                    d = "-0" + i;
                }

                System.out.println(year + m + d);
                if (i + 1 <= day[month - 1]) {
                    if (i + 1 >= 10) {
                        d = "-" + (i+1);
                    } else {
                        d = "-0" + (i+1);
                    }
                    System.out.println(year + m + d);
                }

            }
            }


        }
    }

